/* eslint-disable react-hooks/rules-of-hooks */
import React, { useState, useEffect } from "react";
import {
    Button,
    Card,
    CardHeader,
    CardBody,
  //   CardFooter,
    CardTitle,
    FormGroup,
    Form,
    Input,
    Row,
    Col,
    Label
  } from "reactstrap";
import { useLocation, useNavigate } from "react-router-dom";
import PerfectScrollbar from "perfect-scrollbar";
import Navbar from "components/Navbars/Navbar.js";
import Footer from "components/Footer/Footer.js";
import Sidebar from "components/Sidebar/Sidebar.js";
import '../assets/css/style.css';
import axios from "axios";
// import FixedPlugin from "components/FixedPlugin/FixedPlugin.js";
import jwt from 'jsonwebtoken';
import routes from "user-routes";

var ps;
function ProductOrder(props) {
    const [userId, setUserId] = useState(null);
    const [type,setType]=useState();
    const [category,setCategoy]=useState();
    const [purpose,setPurpose]=useState();
    const [custom,setCustom]=useState();
   
    const navigate = useNavigate()
  
    const handleSubmit=(e)=>{
      e.preventDefault()
      axios.post('http://localhost:3001/signup',{type,category, purpose, custom, userId: userId})
      .then(res=> {
        alert('Regirteres')
        navigate('/login')
      }).catch(err=>console.log(err))
    }

    useEffect(() => {
        // Fetch the JWT token from cookie or local storage
        const token = localStorage.getItem('token') || document.cookie.replace(/(?:(?:^|.*;\s*)token\s*=\s*([^;]*).*$)|^.*$/, "$1");

        if (token) {
            // Decode the JWT token to get user information
            const decoded = jwt.decode(token);

            // Set the user ID in the state
            setUserId(decoded.userId);
        }
    }, []);
const mainPanel = React.useRef();
  const location = useLocation();
  React.useEffect(() => {
    if (navigator.platform.indexOf("Win") > -1) {
      ps = new PerfectScrollbar(mainPanel.current);
      document.body.classList.toggle("perfect-scrollbar-on");
    }
    return function cleanup() {
      if (navigator.platform.indexOf("Win") > -1) {
        ps.destroy();
        document.body.classList.toggle("perfect-scrollbar-on");
      }
    };
  });
  React.useEffect(() => {
    mainPanel.current.scrollTop = 0;
    document.scrollingElement.scrollTop = 0;
  }, [location]);
  // const handleActiveClick = (color) => {
  //   setActiveColor(color);
  // };
  // const handleBgClick = (color) => {
  //   setBackgroundColor(color);
  // };
  return (
    <>
     <div className="wrapper">
      <Sidebar
        {...props}
        routes={routes}
        // bgColor={backgroundColor}
        // activeColor={activeColor}
      />
      <div className="main-panel" ref={mainPanel}>
        <Navbar {...props} />
        <div className="content">
            {userId}
        <Row>
          <Col md="8" style={{margin:'auto'}}>
            <Card className="card-user">
              <CardHeader>
                <CardTitle tag="h5">Make your Order</CardTitle>
              </CardHeader>
              <CardBody>
                <Form>
                <Row>
        <Col md="12">
          <FormGroup>
            <Label for="productType">Product Type</Label>
            <Input type="select" name="productType" id="productType">
              <option value="card">Card</option>
              <option value="board">Board</option>
            </Input>
          </FormGroup>
        </Col>
      </Row>
      <Row>
        <Col md="12">
          <FormGroup>
            <Label for="category">Category</Label>
            <Input type="select" name="category" id="category">
              <option value="wood">Wood</option>
              <option value="plastic">Plastic</option>
              <option value="metal">Metal</option>

            </Input>
          </FormGroup>
        </Col>
      </Row>
      <Row>
                    <Col md="12">
                      <FormGroup>
                        <label>Purpose</label>
                        <Input
                          type="textarea"
                          defaultValue="Purpose of Usage"
                        />
                      </FormGroup>
                    </Col>
                  </Row>
                  <Row>
                    <Col md="12">
                      <FormGroup>
                        <label>Any specific customization</label>
                        <Input
                          type="textarea"
                          defaultValue="You can include link of photograph, or describe any theme as per your need"
                        />
                      </FormGroup>
                    </Col>
                  </Row>
                  <Row>
                    <div className="update ml-auto mr-auto">
                      <Button
                        className="btn-round"
                        color="primary"
                        type="submit"
                      >
                        Update Profile
                      </Button>
                    </div>
                  </Row>
                </Form>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
      <Footer fluid />
      </div>
      </div>
    </>
  );
}

export default ProductOrder;
